claim.claim-text:
1. A method of generating a parameter value to be used as a parameter for a random-number generator, comprising: 
(1) generating a random value; 
(2) using the random value to select a prime number; 
(3) generating the parameter value by multiplying the selected prime number by at least one previously selected prime number; and 
(4) using the parameter value as the parameter for the random-number generator.

10. A method of generating a parameter value to be used as a parameter for a random-number generator, comprising: 
(1) generating a first random value; 
(2) using the first random value to select a first prime number P; 
(3) generating a second random value; 
(4) using the second random value to select a number K such that PK is at most equal to a predetermined maximum number; 
(5) generating the parameter value as a function of PK; and 
(6) using the parameter value as the parameter for the random-number generator.

11. The method of claim 10, further comprising: 
(7) generating a third random value; 
(8) using the third random value to select a second prime number; 
(9) generating a second parameter value by multiplying the selected second prime number by at least one previously selected prime number; and 
(10) using the parameter value and the second parameter value as parameters for the random-number generator.

25. A machine-readable medium having information including instructions for a processor recorded thereon, the instructions comprising: 
(1) generating a random value; 
(2) using the random value to select a prime number; 
(3) generating a parameter value by multiplying the selected prime number by at least one previously selected prime number; and 
(4) using the parameter value as a parameter for the random number generator.

31. A machine-readable medium having instructions recorded thereon for a processor to generate a parameter value as a parameter for a random-number generator, the instructions comprising: 
(1) generating a first random value; 
(2) using the first random value to select a first prime number P; 
(3) generating a second random value; 
(4) using the second random value to select a number K such that PK is at most equal to a predetermined maximum number; and 
(5) generating the parameter value as a function of PK.
